// SPDX-License-Identifier: MIT
pragma solidity 0.8.22;


import "@openzeppelin/contracts/utils/math/Math.sol";

contract MathTest {
    enum Rounding {
        Floor, // Toward negative infinity
        Ceil, // Toward positive infinity
        Trunc, // Toward zero
        Expand // Away from zero
    }
    using Math for uint;
    // xử lý thập phân

    // => luôn nhân với tử 1 số lớn 1e1...1e18

    // (a* 1e18) / b = c => cExtract = (c) / 1e18


    function test(uint256 a, uint256 b) public pure returns(uint) {
        // (x ,y, deno) => (x*y) / deno
        return a.mulDiv(1e18, b); 
    }

    function test(uint256 a, uint256 b, uint256 c) public pure returns(uint256) {
        // (x ,y, deno) => (x*y) / deno
        return a.mulDiv(1e18, b+c); 
    }

    function testMax(uint a, uint b) public pure returns(uint) {
        // (x ,y) => x or y
        return test(a, b,4);
    }

}

